'CREATE OR REPLACE PACKAGE BODY pos_subproductos_pkg AS    FUNCTION generar_codigo_ean13(     p_cod_productor IN VARCHAR2,     p_producto_id   IN NUMBER   ) RETURN VARCHAR2 IS     v_base_codigo  VARCHAR2(12);     v_total        NUMBER := 0;     v_digito_final NUMBER;     v_resultado    VARCHAR2(13);   BEGIN     IF LENGTH(p_cod_productor) != 4 THEN       RAISE_APPLICATION_ERROR(-20001, ''El cdigo de'||
' productor debe tener 4 dgitos.'');     END IF;      v_base_codigo := ''770'' || p_cod_productor || LPAD(p_producto_id, 5, ''0'');     v_base_codigo := SUBSTR(v_base_codigo, 1, 12);      FOR i IN 1 .. 12 LOOP       IF MOD(i, 2) = 0 THEN         v_total := v_total + TO_NUMBER(SUBSTR(v_base_codigo, i, 1)) * 3;       ELSE         v_total := v_total + TO_NUMBER(SUBSTR(v_base_codigo, i, 1));       END IF; '||
'    END LOOP;      v_digito_final := MOD(10 - MOD(v_total, 10), 10);     v_resultado := v_base_codigo || v_digito_final;      RETURN v_resultado;   END generar_codigo_ean13;    PROCEDURE insertar_subproducto(     p_cod_productor IN VARCHAR2,     p_producto_id   IN NUMBER,     p_descripcion   IN VARCHAR2   ) IS     v_codigo_ean13 VARCHAR2(13);   BEGIN     -- Generar el cdigo EAN13     v_codigo_ean'||
'13 := generar_codigo_ean13(p_cod_productor, p_producto_id);      -- Verificar si ya existe     FOR r IN (       SELECT 1 FROM pos_subproductos WHERE codigo_ean13 = v_codigo_ean13     ) LOOP       RAISE_APPLICATION_ERROR(-20002, ''El cdigo EAN13 ya existe: '' || v_codigo_ean13);     END LOOP;      -- Insertar el subproducto     INSERT INTO pos_subproductos (id, codigo_ean13, productor, producto_id, '||
'descripcion)     VALUES (pos_subproductos_seq.NEXTVAL, v_codigo_ean13, p_cod_productor, p_producto_id, p_descripcion);   EXCEPTION     WHEN OTHERS THEN       DBMS_OUTPUT.PUT_LINE(''Error al insertar subproducto: '' || SQLERRM);       RAISE;   END insertar_subproducto;  END pos_subproductos_pkg; '
