 ,p_stmt_text => 
'CREATE OR REPLACE PACKAGE BODY pos_precios_productos_pkg AS    PROCEDURE insertar_precio(     p_subproducto_id IN NUMBER,     p_desde          IN DATE,     p_hasta          IN DATE,     p_precio         IN NUMBER   ) IS     v_conflictos NUMBER;     v_usuario    VARCHAR2(255);   BEGIN     -- Obtener el usuario actual (opcional, para auditora)     v_usuario := sys_context(''USERENV'', ''SESSION_USER'')'||
';          -- Validar que el rango de fechas no se superponga con otro para el mismo subproducto     SELECT COUNT(*) INTO v_conflictos     FROM POS_PRECIOS_PRODUCTOS     WHERE SUBPRODUCTOS_ID = p_subproducto_id       AND NOT (p_hasta < DESDE OR p_desde > HASTA);          IF v_conflictos > 0 THEN       RAISE_APPLICATION_ERROR(-20001, ''El rango de fechas se superpone con un registro existente'');    '||
' END IF;          -- Insertar el registro en la tabla (puedes ajustar ''SOLES'' por el valor predeterminado deseado para MONEDA)     INSERT INTO POS_PRECIOS_PRODUCTOS(       SUBPRODUCTOS_ID,       DESDE,       HASTA,       PRECIO,       MONEDA,       FECHA_CREACION,       CREADO_POR,       FECHA_ACTUALIZACION,       ACTUALIZADO_POR     ) VALUES (       p_subproducto_id,       p_desde,       p_hasta,'||
'       p_precio,       ''SOLES'',       SYSDATE,       v_usuario,       SYSDATE,       v_usuario     );          -- Nota: El manejo de commit se puede dejar a la capa superior, por lo general no se recomienda un COMMIT explcito en procedimientos.   END insertar_precio;  END pos_precios_productos_pkg; '
    ,p_result_size => 0
    ,p_result_rows => 0
    ,p_msg => 'Package Body created.'
    ,p_success => 'Y'
    ,p_failure => 'N'
    ,p_started => to_date('202504160811','YYYYMMDDHH24MI')
    ,p_start_time => 4819868
    ,p_ended => to_date('202504160811','YYYYMMDDHH24MI')
    ,p_end_time => 4819870
    ,p_run_complete => 'Y'
    ,p_last_updated => to_date('202504160811','YYYYMMDDHH24MI'));
end;
