 ,p_command => 
'CREATE OR REPLACE PACKAGE BODY pkg_sesion_usuario IS'||wwv_flow.LF||
'  PROCEDURE establecer_rol(p_usuario IN VARCHAR2) IS'||wwv_flow.LF||
'  BEGIN'||wwv_flow.LF||
'    SELECT r.rol'||wwv_flow.LF||
'    INTO g_rol_actual'||wwv_flow.LF||
'    FROM roles_usuario r'||wwv_flow.LF||
'    WHERE r.usuario = UPPER(p_usuario)'||wwv_flow.LF||
'    FETCH FIRST ROW ONLY;'||wwv_flow.LF||
'  EXCEPTION'||wwv_flow.LF||
'    WHEN NO_DATA_FOUND THEN'||wwv_flow.LF||
'      g_rol_actual := ''Invitado'';'||wwv_flow.LF||
'  END establecer_rol;'||wwv_flow.LF||
''||wwv_flow.LF||
'  FUNCTION obtener_rol RETURN VARCHAR2 IS'||wwv_flow.LF||
'  BEGIN'||wwv_flow.LF||
'    RETURN'||
' g_rol_actual;'||wwv_flow.LF||
'  END obtener_rol;'||wwv_flow.LF||
'END pkg_sesion_usuario;'
    ,p_created_by => 'JORGERIOSGOMEZ@GMAIL.COM'
